import React, { Component, Fragment} from 'react';
import Data from './OverdueData.json';
import SearchResultNum from './SearchResultNum';
import SearchResultNone from './SearchResultNone';
import SearchResultItem from './SearchResultItem';

class Overdue extends Component{
	render() {
		let searchResult;
		Data.data.sort(Data.data.checkout.overdueDay);
		if (Data.count === 0)
			searchResult = <SearchResultNone />
		else
			searchResult = <SearchResultItem Data = {Data.data}/>

		return (
			<Fragment>
				<SearchResultNum count = {Data.count}/>
				{searchResult}
			</Fragment>
		);
	}
}

export default Overdue;
